import React from 'react';
import Figure from 'react-bootstrap/Figure'

function AlbumCard({album,thumbnail, year, description }) {
  return (
    <Figure>
      <Figure.Image
        width={171}
        height={180}
        alt="171x180"
        src= {thumbnail}
      />
    <Figure.Caption>
      {album}
      {year}
      {description}
    </Figure.Caption>
  </Figure>
  );
}

export default AlbumCard;
